#include <iostream>
#include <string>
#include <vector>
#include <unordered_set>

using namespace std;

class Solution {
public:
  int getMatches(string s, string str) {
    // Build table first (KMP algorithm)
    vector<int> tab(str.size());
    int k = 0;
    tab[0] = 0;
    for (int i = 1; i < str.size(); i++) {
//      cout << "i: " << i << " k: " << k << endl;
      while (k > 0 && str[i] != str[k]) {
        k = tab[k-1];
      }
      if (str[i] == str[k]) {
        k++;
      }
      tab[i] = k;
    }
//    for (int i = 0; i < str.size(); i++) {
//      cout << "tab[" << i << "]: " << tab[i] << endl;
//    }
//    cout << "Came: " << endl;
    // Now match
    int m = 0;
    k = 0;
    for (int i = 0; i < s.size(); i++) {
      while (k > 0 && s[i] != str[k]) {
        k = tab[k-1];
      }
      if (s[i] == str[k]) {
        k++;
      }
      if (k == str.size()) {
        m++;
        k = tab[k-1];
      }
    }
//    cout << "M: " << m;
    return m;
//    for (int i = 0; i < str.size(); i++) {
//      cout << "tab[" << i << "]: " << tab[i] << endl;
//    }
  }

  vector<string> findRepeatedDnaSequences(string s) {
    vector<string> res;
    if (s.size() < 10) {
      return res;
    }
    string str;
    int m;
    unordered_set<string> checked;
    for (int i = 0; i <= s.size()-10; i++) {
      str = s.substr(i, 10);
//      cout << s << ", " << str << endl;
      if (checked.find(str) == checked.end()) {
        m = getMatches(s, str);
        checked.insert(str);
        if (m > 1) {
          res.push_back(str);
        }
      }
    }
//    getMatches("abcabcab", "abca");
    return res;
  }
};

int main() {
  Solution s;
  string str = "";//GAGAGAGAGAGAG";//"AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT";

  vector<string> res = s.findRepeatedDnaSequences(str);

  for (int i = 0; i < res.size(); i++) {
    cout << res[i] << endl;
  }
//  cout << endl;
  return 0;
}